import React , {Component} from "react";
import Children_header from "./Children_header";

class Header extends Component { 
    constructor(){
      super();
      this.state = {
        name : "Reda Eskouni"
      }
    }

    change_name =(event)=>{
      this.setState((e)=>{
        styling : {return e.name + " Clicking in button "}
      })
      
    }
    
    render(){
      return (
          <header>
            {this.state.name}
            <Children_header  />
          </header>
      );
    }
}

export default Header;
